import React, { Component, Fragment } from 'react';
import mountains from '../../images/moutains.jpeg';
import logo2 from '../../images/GoalieGuruLogo2.png';
import { MarqueeGradient, MarqueeLogo, MarqueeImage } from './Marquee.styled.js';

class Marquee extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <Fragment>
        <br />
        <br />
        <br />
        <br />
        <MarqueeGradient>
          <MarqueeLogo src={logo2} />
          <MarqueeImage src={mountains} />
        </MarqueeGradient>
      </Fragment>
    );
  }
}

export default Marquee;
